import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Chip from '@material-ui/core/Chip';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import Divider from '@material-ui/core/Divider';
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
      maxWidth: '100%',
    },
    imagep: {
        width : 600,
        left: -600,
        transform: "translate(-600px, 0px)",

    }

  }));

export default function Item() {
    const classes = useStyles();

    return (
        <Container component="main" maxWidth="xs">
            <div >
                <Grid container alignItems="center">
                    <Link
                        component="button"
                        onClick={() => {
                        console.info("I'm a button.");
                        }}
                    >
                        Back to result
                    </Link>
                </Grid>
                <Divider variant="middle" /> 
                <figure class="iw multimage">
                <div class="gallery">
        <span class="slider-back arrow">&lt;</span>
        <span class="slider-info">image 3 of 7</span>
        <span class="slider-forward arrow">&gt;</span>

        <div class="swipe" >
            <div class="swipe-wrap">
                <div id="1_image_QJWpyWnmpl_0bC0fu" data-imgid="QJWpyWnmpl_0bC0fu" class="slide first visible" data-index="0" >
                    <img src="https://images.craigslist.org/00q0q_QJWpyWnmpl_0bC0fu_600x450.jpg" title="1" alt="1"></img>
                </div>
                <div id="2_image_iwsGpr6TvUk_0fu06L" data-imgid="iwsGpr6TvUk_0fu06L" class="slide" data-index="1" ><picture><img src="https://images.craigslist.org/00B0B_iwsGpr6TvUk_0fu06L_600x450.jpg"></img></picture></div>
                <div id="3_image_6hUl2Z5hO4F_0cz0fu" data-imgid="6hUl2Z5hO4F_0cz0fu" class="slide" data-index="2" ><picture><img src="https://images.craigslist.org/00l0l_6hUl2Z5hO4F_0cz0fu_600x450.jpg"></img></picture></div>
                <div id="4_image_j4qmjs3EX5h_0fv06G" data-imgid="j4qmjs3EX5h_0fv06G" class="slide" data-index="3" ><picture><img src="https://images.craigslist.org/00F0F_j4qmjs3EX5h_0fv06G_600x450.jpg"></img></picture></div>
                <div id="5_image_c1JZDGeJ8yF_0eq0fu" data-imgid="c1JZDGeJ8yF_0eq0fu" class="slide" data-index="4" ><picture><img src="https://images.craigslist.org/01111_c1JZDGeJ8yF_0eq0fu_600x450.jpg"></img></picture></div>
                <div id="6_image_asLMGeWbZaY_0bC0fu" data-imgid="asLMGeWbZaY_0bC0fu" class="slide" data-index="5" ><picture><img src="https://images.craigslist.org/00s0s_asLMGeWbZaY_0bC0fu_600x450.jpg"></img></picture></div>
                <div id="7_image_bejyfBRWXQn_0eW0fu" data-imgid="bejyfBRWXQn_0eW0fu" class="slide" data-index="6" ><picture><img src="https://images.craigslist.org/00c0c_bejyfBRWXQn_0eW0fu_600x450.jpg"></img></picture></div>
            </div>
        </div>
    </div>
                    </figure>       
            </div>
        
        </Container>
     
    );
}
